import React, { useEffect } from 'react';
import LandingPage from './LandingPage';
import api from './axios';

function App() {
  useEffect(() => {
    api.get('/test')
      .then(res => console.log(res.data))
      .catch(err => console.error(err));
  }, []);

  return <LandingPage />;
}

export default App;
